import * as React from 'react';
import styled from '@mui/system/styled';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import HomeIcon from '@mui/icons-material/Home';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MenuIcon from '@mui/icons-material/Menu'; // Importa el ícono de menú
import ListItemIcon from '@mui/material/ListItemIcon';


const StyledAppBar = styled(AppBar)({
  top: 'auto',
  bottom: 0,
  background: '#344955',
  boxShadow: 'none',
  borderTop: '1px solid #FCFCFC',
  position: 'fixed',
  width: '100%',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: '-40%',
    left: '50%',
    transform: 'translateX(-50%)',
    width: '5%', // Ajusta el ancho de la sección circular
    height: '100%',
    background: '#FCFCFC', // Color del fondo de la sección circular
    borderRadius: '50%', // Ajusta los radios para una forma más circular
  },
});

const CenteredBox = styled('div')({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  width: '100%',
  padding: '0 16px',
});

const CircularIconButton = styled(IconButton)({
  borderRadius: '50%',
  backgroundColor: '#F9AA33',
  '&:hover': {
    backgroundColor: '#F9AA33',
  },
});

const HomeIconButton = styled(CircularIconButton)({
  marginLeft: '-16px',
});

export default function BottomAppBar() {
  return (
    <StyledAppBar>
      <Toolbar>
        <CenteredBox>
          {/* Reemplaza MoreIcon con MenuIcon */}
          <IconButton size="large" edge="start" color="#ecf3f3" aria-label="open drawer">
            <MenuIcon />
          </IconButton>
          <HomeIconButton size="large" color="#ecf3f3" aria-label="home" style={{  marginLeft: '0px', marginTop: '-50px'  }}>
              <Edit/>
          </HomeIconButton>
          <IconButton size="large" edge="end" color="#ecf3f3" aria-label="account">
            <AccountCircleIcon />
          </IconButton>
        </CenteredBox>
      </Toolbar>
    </StyledAppBar>
  );
}
